    <div className="App">
      {<CryptoTable />}
    </div>
  );
}



function CryptoTable() {

  const [data,setData] = useState("");
  const res = "";

  async function fetchData() {
    const res = await fetch("http://localhost:8080/ExcerciseThursday/api/crypto");
    res.json().then(res => setData(res));
    return res;
  }


  useEffect(() => {
    fetchData();
    console.log(res);
    setData({res});
  })

  return (
    <div>{data}</div>
  )
}

export default App;
